// PaceHeartRateGraph.js
import React from 'react';
import { Line } from 'react-chartjs-2';

const PaceHeartRateGraph = ({ data }) => {
  const paceRanges = Object.keys(data);

  const chartData = {
    labels: paceRanges,
    datasets: Object.keys(data).map((year) => ({
      label: year,
      data: data[year].map((averageHeartRate) => averageHeartRate),
    })),
  };

  const options = {
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'Average Heart Rate',
        },
      },
      x: {
        title: {
          display: true,
          text: 'Pace Range',
        },
      },
    },
  };

  return <Line data={chartData} options={options} />;
};

export default PaceHeartRateGraph;
